CREATE TEMPORARY TABLE pat_enp(enp text);


SELECT * FROM pat_enp;

SELECT pe.*, (SELECT jsonb_path_query_first(p.resource, '$.identifier ? (@.system == "urn:identity:snils:Patient").value') #>> '{}'
			  FROM patient p 
			  WHERE p.resource @@ concat('identifier.#(system = "urn:identity:enp:Patient" and value = "', pe.enp, '")')::jsquery
			  LIMIT 1) snils
FROM pat_enp pe  
--LEFT JOIN patient p ON p.resource @@ concat('identifier.#(system = "urn:identity:enp:Patient" and value = "', pe.enp, '")')::jsquery
--pe.enp = jsonb_path_query_first(p.resource, '$.identifier ? (@.system == "urn:identity:enp:Patient").value') #>> '{}'

SELECT jsonb_path_query_first(p.resource, '$.identifier ? (@.system == "urn:identity:snils:Patient").value') #>> '{}'
FROM patient p 
LIMIT 1